            props.axalisabolooMoxmareba[i] =
              props.axalisabolooMoxmareba[i] +
              (props.axalisabolooMoxmareba[i] * props.infoprecent[ar1[i]]) /
                100;
            props.setnewvalue(props.axalisabolooMoxmareba);
          } else {
            // console.log("can't update 1");
            console.log(props.info[ar1[i]])

          }
          console.log(props.newval[i] * props.info[ar1[i]]/100)
        }
      }
      // ricxvit
      for (let i = 0; i < ar1.length; i++) {
        if (props.info[ar1[i]].length !== 0) {
          if (props.infoprecent[ar1[i]].length === 0) {
            props.axalisabolooMoxmareba[i] =
              props.axalisabolooMoxmareba[i] + props.info[ar1[i]] * 1;
            props.setnewvalue(props.axalisabolooMoxmareba);
          } else {
            // console.log("can't update 2");
          }
        }
      }
    },
    // eslint-disable-next-line
    [props.info, props.infoprecent]
  );

  function ClearData() {
    window.location.reload(false);
  }

  function changeInputValue(event) {
    for (let v = 0; v < ar1.length; v++) {
      if (props.infoprecent[ar1[v]].length !== 0) {
        if (
          event.target.id.toLowerCase() === Object.keys(props.infoprecent)[v]
        ) {
          event.target.value = (
            (props.old[v] * props.infoprecent[ar1[v]]) /
            100
          ).toFixed(2);
          props.SetInfoPrecent({ ...props.infoprecent, v: event.target.value });
        }
      }
    }
  }

  function changeInputValueFromNumber(event) {
    for (let v = 0; v < ar1.length; v++) {
      if (props.info[ar1[v]].length !== 0) {
        if (event.target.id.toLowerCase() === Object.keys(props.info)[v]) {
          event.target.value = (
            (props.info[ar1[v]] / props.old[v]) *
            100
          ).toFixed(2);
          props.SetInfo({ ...props.info, v: event.target.value });
        }
      }
    }
  }

